import random
import json
import win_prob_calculator
import numpy as np

# Will do this based on bankroll because they never fold, and the pot odds are almost always 50/50 when it's headsup
def get_betsize(stage, user_dict, entry, betted):
    """
    'k': 'check',
    'b': 'bet',
    'c': 'call',
    'r': 'raise',
    """
    if stage == "p":
        n = 0
    if stage == "f":
        n = 1
    if stage == "t":
        n = 2
    if stage == "r":
        n = 3
    
    betsize = entry["pots"][n]["size"] / 2 - betted
    betsize_to_bankroll = betsize / user_dict["bankroll"]
    if "r" in user_dict["bets"][n]["actions"]:
        return ("raise", betsize, betsize_to_bankroll)
    if "c" in user_dict["bets"][n]["actions"]:
        return ("c", betsize, betsize_to_bankroll)
    if "k" in user_dict["bets"][n]["actions"]:
        return ("k", betsize, betsize_to_bankroll)
    if "A" in user_dict["bets"][n]["actions"]:
        return ("A", user_dict["bankroll"], 1.0)
    else:
        return ("undefined", 0, 0)
    
# gotta check if undefined and not add it

def win_percentage_dict(user_dict, flop, turn, river, entry):
    hands_dict = {}
    pocket_cards = user_dict["pocket_cards"]
    betted = 0
    
    win_prob_p = win_prob_calculator.win_prob([], pocket_cards)
    betsize_info_p = get_betsize("p", user_dict, entry, betted)
    betted += betsize_info_p[1]
    hands_dict["p"] = {"winprob": win_prob_p, "betsize_info": betsize_info_p}
     
    win_prob_f = win_prob_calculator.win_prob(flop, pocket_cards)
    betsize_info_f = get_betsize("f", user_dict, entry, betted)
    betsize_f = betsize_info_f[1]
    bet_size_array.append(betsize_f)
    win_prob_array.append(win_prob_f)
    betted += betsize_f
    hands_dict["f"] = {"winprob": win_prob_f, "betsize_info": betsize_info_f}

     
    win_prob_t = win_prob_calculator.win_prob(turn, pocket_cards)
    betsize_info_t = get_betsize("t", user_dict, entry, betted)
    betsize_t = betsize_info_t[1]
    bet_size_array.append(betsize_t)
    win_prob_array.append(win_prob_t)
    betted += betsize_t
    hands_dict["t"] = {"winprob": win_prob_t, "betsize_info": betsize_info_t}

    
    win_prob_r = win_prob_calculator.win_prob(river, pocket_cards)
    betsize_info_r = get_betsize("r", user_dict, entry, betted)
    betsize_r = betsize_info_r[1]
    bet_size_array.append(betsize_r)
    win_prob_array.append(win_prob_r)
    betted += betsize_r
    hands_dict["r"] = {"winprob": win_prob_r, "betsize_info": betsize_info_r}

    return hands_dict

